import './Hello.css'

class Hello extends Component{
	render(){
		return (
			<div className='f3 tc'>
				<h1>hello world</h1>
				// <p>Support LGBT support us!</p>
				<p>{this.prop.greeting}</p>
			</div>
		);
	}
}


export default Hello;
